import {inject, Injectable} from '@angular/core';
import {Auth, authState, createUserWithEmailAndPassword, signInWithEmailAndPassword} from "@angular/fire/auth";
import {DatabaseServiceService} from "@app/core/services/database/database.service.service";
import {Credentials, UserDto} from "@/types";

@Injectable({
  providedIn: 'root'
})
export class AuthServiceService {
  private readonly auth: Auth = inject(Auth)
  private readonly userDataBase: DatabaseServiceService = inject(DatabaseServiceService)

  readonly authState = authState(this.auth)

  constructor() { }


  async login(credentials: Credentials){
    return await signInWithEmailAndPassword(this.auth, credentials.email, credentials.password)
  }

  async register(credentials: UserDto){
    console.log(credentials)
    await this.userDataBase.createUser(credentials)
    const {email, password} = credentials
    return await createUserWithEmailAndPassword(this.auth, email, password)
  }

  logout(){
    return this.auth.signOut()
  }
}

import {inject, Injectable} from '@angular/core';
//import {Database} from "@angular/fire/database";
import {addDoc, collection, doc, Firestore, getDocs, query, where} from "@angular/fire/firestore";
import {UserDto} from "@/types";
import {User} from "@/stories/user";

@Injectable({
  providedIn: 'root'
})
export class DatabaseServiceService {
  private readonly dataBase: Firestore = inject(Firestore)

  private readonly collection$ = collection(this.dataBase, 'users');
  constructor() { }


  private document(path: string, id: string){
    return doc(this.dataBase, `${path}/${id}`)
  }

  async createUser(data: UserDto){
    return await addDoc(this.collection$, data)
  }


  async getUser(id: string){
    try {
      let user: UserDto = {} as UserDto

      const q = query(this.collection$, where('id', '==', id))

      const querySnapshot = await getDocs(q)


      querySnapshot.forEach((doc) =>{
        user = {...doc.data() as UserDto}
      })

      return user


    } catch (error) {
      console.error(error)
      return  {} as UserDto
    }
  }
}

