  isOpen = false;
  isPanelOpen = false;

  open() {
    this.isOpen = true;
    setTimeout(() => {
      this.isPanelOpen = true;
    }, 10);
  }

  close() {
    this.isPanelOpen = false;
    setTimeout(() => {
      this.isOpen = false;
    }, 500);
  }

}

