import {Component, inject} from '@angular/core';
import {AuthServiceService} from "@app/core/services/auth/auth.service.service";
import {catchError, EMPTY, tap} from "rxjs";
import {UserSchema} from "@/types";

@Component({
  selector: 'app-profile',
  standalone: true,
  imports: [],
  templateUrl: './profile.component.html',
})
export default class ProfileComponent {

  private _authService = inject(AuthServiceService)

  protected userInstance: UserSchema | null = null;



  ngOnInit() {
    this._authService.authState.pipe(
      tap((user) => {
        const data = user
        this.userInstance = new UserSchema(
          user?.email as string,
          user?.displayName || 'Anonymous',
          user?.photoURL || 'https://firebasestorage.googleapis.com/v0/b/auth-example-9a434.appspot.com/o/uploads%2FCiberamenazas%20y%20Tendencias%202019%20»%20Un%20mundo%20complejo.jpg?alt=media&token=695a38fc-f671-4639-8890-a6afbe7a1b97',
          user?.emailVerified as boolean,
          user?.phoneNumber as string,
          user?.providerData[0]?.providerId as string
        )
      }),
      catchError((error) => {
        console.error(error)
        return EMPTY
      })
    ).subscribe()
    console.log(this.userInstance)
  }
}

import {Component, inject} from '@angular/core';
import {ButtonsComponent} from "../components/buttons/buttons.component";
import {ContainerComponent} from "../components/container/container.component";
import {Router, RouterLink} from "@angular/router";
import { FormControl, FormGroup, FormsModule, ReactiveFormsModule, Validators} from "@angular/forms";
import {FormDto, UserDto} from "@/types";
import {AuthServiceService} from "@app/core/services/auth/auth.service.service";
import swalt from "sweetalert2"




@Component({
  selector: 'app-sign-up',
  standalone: true,
  imports: [
    ButtonsComponent,
    ContainerComponent,
    RouterLink,
    FormsModule,
    ReactiveFormsModule
  ],
  templateUrl: './register.component.html',
  styleUrl: './register.component.scss'
})
export class RegisterComponent {

  private readonly auth = inject(AuthServiceService)
  private readonly router: Router = inject(Router)

  protected form: FormGroup<FormDto>;

  showPassword: boolean = false;
  isAuthenticated: boolean = false;
  constructor() {
    this.form = new FormGroup<FormDto>({
      name: new FormControl('alguien test', [
        Validators.required,
        Validators.minLength(4)
      ]),
      lastName: new FormControl('lasts test', [
        Validators.required,
        Validators.minLength(4)
      ]),
      email: new FormControl('cademi4911@jadsys.com', [
        Validators.required,
        Validators.email
      ]),
      role: new FormControl<"Admin" | "Client">('Client', [
        Validators.required,
        Validators.pattern(/Admin|Client/)
      ]),
      password: new FormControl('n8pnU9xrVAjJz*', [
        Validators.required,
        Validators.minLength(8),
        Validators.pattern(/^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)(?=.*[@$!%*?&])[A-Za-z\d@$!%*?&]{8,}$/)
      ])
    })
  }

  async submit(){
    /*
    aPgyc#P7@N2Lh5 -> cademi4911@jadsys.com
    n8pnU9xrVAjJz*
    T#uqP#tA7AA&Mf
     */
    if (!this.form.valid) return
    try {
      const data = this.form.value
      const credentials: UserDto = {
        email: data.email,
        name: data.name,
        lastName: data.lastName,
        password: data.password,
        role: data.role
      } as UserDto

      const {user} = await this.auth.register(credentials)

      if (user){
        await swalt.fire({
          icon: "success",
          title: `<div>
                     <h2 class="text-2xl font-bold text-blue-900"> Cuenta creada con exito</h2>
                     <p class="text-sky-600">
                      ${user.email}
                     </p>
                </div>`,
          showConfirmButton: false,
          timer: 2000,
          background: '#1a202c'
        })
        this.form.reset()
        await this.router.navigateByUrl("/dashboard")
      }

    }catch (e){
      if (e instanceof Error) {
        alert(`Error if ${e.message}`)
        console.error(e.message)
      }else {
        alert(`Error else ${e}`)
      }
    }
  }
}

